import React from "react";
import "../styles/dashboard.css"; // Ensure dashboard styles are imported

const DashboardHeader = () => {
    return (
        <header>
          <div className="left-section">
          {/* Menu Icon */}
          <i className="bx bx-menu menu-icon"></i>

          {/* Navigation Links */}
          <nav>
            <ul className="nav-links">
              <li><a href="#">Overview</a></li>
              <li><a href="#">My Timestamps</a></li>
              <li><a href="#">Integrations</a></li>
              <li><a href="#">Automate & API</a></li>
            </ul>
          </nav>
        </div>

        <div className="right-section">
          {/* Start Free Trial Button */}
          <button className="trial-button">Start free Trial</button>

          {/* Notification Icon with Badge */}
          <div className="notification">
            <i className="bx bx-bell bell-icon"></i>
            <span className="badge">8</span>
          </div>

          {/* User Dropdown */}
          <div className="user-dropdown">
            <span>Not applicable</span>
            <i className="bx bx-chevron-down"></i>
          </div>
        </div>
      </header>
    );
};

export default DashboardHeader;
